// SPDX-License-Identifier: MIT
pragma solidity >=0.7.4;
import "../interfaces/IUniswapV3Pool.sol";
import "../interfaces/callback/IUniswapV3MintCallback.sol";
import "../interfaces/callback/IUniswapV3SwapCallback.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";

contract UniswapV3PoolWrapper is
    IUniswapV3MintCallback,
    IUniswapV3SwapCallback
{
    IUniswapV3Pool pool;
    IERC20 public immutable token0;
    IERC20 public immutable token1;

    constructor(address poolAddress) {
        pool = IUniswapV3Pool(poolAddress);
        token0 = IERC20(pool.token0());
        token1 = IERC20(pool.token1());
    }

    function deposit(uint256 amount0, uint256 amount1) external {
        if (amount0 > 0)
            SafeERC20.safeTransferFrom(
                token0,
                msg.sender,
                address(this),
                amount0
            );
        if (amount1 > 0)
            SafeERC20.safeTransferFrom(
                token1,
                msg.sender,
                address(this),
                amount1
            );
    }

    function uniswapV3MintCallback(
        uint256 amount0Owed,
        uint256 amount1Owed,
        bytes calldata data
    ) external override {
        require(msg.sender == address(pool));
        if (amount0Owed > 0)
            SafeERC20.safeTransfer(token0, msg.sender, amount0Owed);
        if (amount1Owed > 0)
            SafeERC20.safeTransfer(token1, msg.sender, amount1Owed);
    }

    function mint(
        int24 tickLower,
        int24 tickUpper,
        uint128 amount,
        bytes calldata data
    ) external returns (uint256 amount0, uint256 amount1) {
        (amount0, amount1) = pool.mint(
            address(this),
            tickLower,
            tickUpper,
            amount,
            data
        );
        emit PrintAmounts(amount0, amount1);
    }

    function swap(
        bool zeroForOne,
        int256 amountSpecified,
        uint160 sqrtPriceLimitX96,
        bytes calldata data
    ) external returns (int256, int256) {
        return
            pool.swap(
                address(this),
                zeroForOne,
                amountSpecified,
                sqrtPriceLimitX96,
                data
            );
    }

    function uniswapV3SwapCallback(
        int256 amount0Delta,
        int256 amount1Delta,
        bytes calldata data
    ) external override {
        require(msg.sender == address(pool));
        if (amount0Delta > 0)
            SafeERC20.safeTransfer(token0, msg.sender, uint256(amount0Delta));
        if (amount1Delta > 0)
            SafeERC20.safeTransfer(token1, msg.sender, uint256(amount1Delta));
    }

    event PrintAmounts(uint256 amount0, uint256 amount1);
}
